import React from 'react';
import styled from 'styled-components';

const Road = styled('div')`
  display: flex;

  margin-left:50px;
  background-color: #E8E5E5;
  max-width: 100%;
  width:auto;
  color: blue;
  padding: 32px;
  opacity: 30%;
`;

export default Road;
